import React from "react"
import '../style/header.css'

const Header = () =>{
    return (
        <div className="container">
            <ul className="navbar">
                <li className="nav-item home" ><a href="#">Home<div className="underline"></div></a></li>
                <li className="nav-item catalog"><a href="">Catalog</a></li>
                <li className="nav-item cart"><a href="">Cart</a><i className="fa fa-shopping-cart" aria-hidden="true"></i></li>
            </ul>

        </div>
    );
}

export default Header;
